import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import "./App.css";
import Lv from "./Lv";
import Eng from "./Eng";

const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Route to="/" exact component={Lv} />
        <Route to="/eng" component={Eng} />
      </BrowserRouter>
    </div>
  );
};

export default App;
